import React,{Component} from 'react';
import classes from './PostedAd.module.css'

class PostedAd extends Component{

    render(){
        return(
            <div className={classes.tag7}>

        <span><strong>Pickup Location :</strong>{this.props.pickup}</span>
        <p><strong>Drop Location :</strong>{this.props.drop}</p>    
        <p><strong>Date :</strong>{this.props.date}</p>    
        <p><strong>Contact :</strong>{this.props.contact}</p>    

            </div>
        )
    }

}

export default  PostedAd;
